tables.table_schema:
CREATE TABLE licensing_agreements (
    agreement_id INT PRIMARY KEY,
    agreement_name VARCHAR(255),
    terms_and_conditions TEXT
);

CREATE TABLE ip_tracking (
    ip_id INT PRIMARY KEY,
    ip_name VARCHAR(255),
    license_id INT
);

CREATE TABLE license_history (
    history_id INT PRIMARY KEY,
    license_id INT,
    action VARCHAR(50),
    action_date TIMESTAMP
);
